description:
**Goals**

The project has to contribute to the following impact and must achieve the outcomes and outputs as stated below.

**Long-term impact**

	Water is used sustainably and equitably, ensuring the needs of all sectors and the environment;
	Water efficiency in agriculture is increased.

**Medium-term impact**

	Education system (TVET/HE) is of good quality, relevant and accessible (SDG 4);
	Partnerships between persons and organisations are inclusive and sustainable;
	Organisations key to (sectoral) inclusive development of partner countries are strengthened by inflow of enhanced workforce

**Outcomes at project level**

	TVET/HE organizations in Egypt perform better their core tasks and are firmly embedded in their environment; 
	Enhanced knowledge and skills of individuals and organizations in line with the country specific labour market needs and aiming inclusiveness in partner countries and in the NL.

